        /// <summary>
        /// Returns detailed information about the threat status of one unit against another. The different values returned by this function reflect the complexity of NPC threat management:Raw threat roughly equates to the amount of damage a unit has caused to the NPC plus the amount of healing the unit has performed in the NPC's presence. (Each quantity that goes into this sum may be modified, however; such as by a paladin's Righteous Fury self-buff, a priest's Silent Resolve talent, or a player whose cloak is enchanted with Subtlety.)Generally, whichever unit has the highest raw threat against an NPC becomes its primary target, and raw threat percentage simplifies this comparison.However, most NPCs are designed to maintain some degree of target focus -- so that they don't rapidly switch targets if, for example, a unit other than the primary target suddenly reaches 101% raw threat. The amount by which a unit must surpass the primary target's threat to become the new primary target varies by distance from the NPC.Thus, a scaled percentage value is given to provide clarity. The rawPercentvalue returned from this function can be greater than 100 (indicating that unithas greater threat against mobUnitthan mobUnit's primary target, and is thus in danger of becoming the primary target), but the scaledPercentvalue will always be 100 or lower.Threat information for a pair of units is only returned if the player has threat against the NPC unit in question. (For example, no threat data is provided if the player's pet is attacking an NPC but the player himself has taken no action, even though the pet has threat against the NPC.)
        /// </summary>
        /// <param name="unit">The unit whose threat situation is being requested (unitid)</param>
        /// <param name="name">The name of a unit to query. Only valid for the player, pet, and party/raid members. (string)</param>
        /// <param name="mobUnit">An NPC unit the first unit may have threat against (unitid)</param>
        /// <example>isTanking,status,scaledPercent,rawPercent,threatValue=UnitDetailedThreatSituation(unit,mobUnit)orUnitDetailedThreatSituation("name",mobUnit)</example>
        internal static string[] UnitDetailedThreatSituation(string unit, string name, string mobUnit)
        {
            return Run("UnitDetailedThreatSituation({0},{2})orUnitDetailedThreatSituation(\"{1}\",{2})", unit, name, mobUnit); //isTanking,status,scaledPercent,rawPercent,threatValue
        }

